import React from 'react';
import logo from './logo.svg';
import './App.css';
import CreatePoll from './components/Poll/Poll';
import Poll from './components/Poll/Poll';

function App() {
  return (
    <div className="App">
      <CreatePoll />
      <Poll title={"Who is gonna win!"} options={["Chenzo", "Marky", "Flax", "Ally"]}/>
    </div>
  );
}

export default App;
